import EmpList from "./EmpList";
import { BrowserRouter as Router,Routes,Route } from "react-router-dom";
function Emp(){
    return(
        <div>
            <Router>
                <Routes>
                    <Route path="/" element={<EmpList/>}/>
                </Routes>
            </Router>

        </div>
    )
}
export default Emp;
